/**
 * @param {number[]} A
 * @param {number[]} B
 * @return {number[]}
 */
var advantageCount = function(A, B) {

  var sortA = A.map(function(elem, i) {
    return {
      i: i,
      v: elem,
    }
  }).sort(function (item1, item2) {
    return item1.v - item2.v;
  })

  var sortB = B.map(function(elem, i) {
    return {
      i: i,
      v: elem,
    }
  }).sort(function (item1, item2) {
    return item1.v - item2.v;
  })

  // console.log({ sortA, sortB });

  var result = [];
  for(var i = 0; i < sortB.length; i ++) {
    var elemB = sortB[i];
    var biggerAIdx = sortA.findIndex(function (elemA) {
      return elemA.v > elemB.v;
    })
    if (biggerAIdx < 0) {
      continue;
    }
    result[elemB.i] = sortA[biggerAIdx];
    sortA.splice(biggerAIdx, 1);
  }

  // console.log(result);
  
  for(var i = 0; i < B.length; i++) {
    if (result[i] === undefined) {
      result[i] = sortA[0];
      sortA.shift();
    }
  }

  // console.log(result);

  return result.map(function (elem) {
    return elem.v;
  })
};

